CREATE DEFINER=`root`@`localhost` PROCEDURE `GetEmpLeaveBlance` ()   BEGIN
SELECT
    MIN(id) AS id,
    empid,
    MAX(CASE WHEN leave_type_id = 'SI_L' THEN balance_amount END) AS SI_L,
    MAX(CASE WHEN leave_type_id = 'SP_L' THEN balance_amount END) AS SP_L,
    MAX(CASE WHEN leave_type_id = 'AN_L' THEN balance_amount END) AS AN_L,
    MAX(CASE WHEN leave_type_id = 'MT_L' THEN balance_amount END) AS MT_L
FROM
    leave_balance lb 
GROUP BY
    empid;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetEmployeeHierarchy` (IN `manId` BIGINT, IN `depId` BIGINT)   BEGIN
    WITH RECURSIVE EmployeeHierarchy AS (
        SELECT
            *
        FROM
            employee
        WHERE
            manager_id >  manId -- Top manager's empid
          AND department_id = depId  -- Specific department ID

        UNION ALL

        SELECT
            e.*
        FROM
            employee e
                INNER JOIN
            EmployeeHierarchy eh ON e.manager_id = eh.empid
        WHERE
            e.department_id = depId  -- Specific department ID
    )
    SELECT
        *
    FROM
        EmployeeHierarchy;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetFirstAndSecondPayments` (IN `ref_no` VARCHAR(255))   BEGIN
    -- Common Table Expression (CTE) to rank payments
    WITH RankedPayslips AS (
        SELECT 
            p.empId,
            p.ref_no,
            p2.salary,
            p.type AS payroll_type,
            p.status AS payroll_status,
            p2.allowances,
            p2.allowance_amount,
            p2.deductions,
            p2.deduction_amount,
            p2.net,
            p.date_created,
            ROW_NUMBER() OVER (PARTITION BY p.empId, p.ref_no ORDER BY p.date_created ASC) AS payment_order
        FROM 
            cats_hrms.payroll p
        INNER JOIN 
            cats_hrms.payslip p2 ON p2.payroll_id = p.id
    )
    SELECT 
        r.empId,
        r.ref_no,
        r.salary,
        CASE 
            WHEN r.payroll_type = 1 THEN 'Monthly'
            WHEN r.payroll_type = 2 THEN 'Semi-Monthly'
            ELSE 'Unknown'
        END AS type,
        CASE 
            WHEN r.payroll_status = 1 THEN 'New'
            WHEN r.payroll_status = 2 THEN 'Computed'
            ELSE 'Unknown'
        END AS status,
        GROUP_CONCAT(r.allowances SEPARATOR ', ') AS allowances,
        SUM(r.allowance_amount) AS total_allowances,
        GROUP_CONCAT(r.deductions SEPARATOR ', ') AS deductions,
        SUM(r.deduction_amount) AS total_deductions,
        ROUND(SUM(r.net), 2) AS net,
        r.date_created AS 'date',
        ROUND(SUM(r.net), 2) AS total_earning,
        (SELECT t.rate 
         FROM cats_hrms.tax t 
         WHERE t.lowerLimit <= r.salary * er.rate AND t.upperLimit >= r.salary * er.rate
         LIMIT 1) AS tax_rate,
        CASE
            WHEN r.payment_order = 1 THEN 'First Payment'
            WHEN r.payment_order = 2 THEN 'Second Payment'
            ELSE NULL
        END AS payment_sequence
    FROM 
        RankedPayslips r
    INNER JOIN 
        (SELECT rate 
         FROM exchange_rate 
         WHERE currency_from = 'USD' AND currency_to = 'KHR'
         ORDER BY date_updated DESC
         LIMIT 1) er ON TRUE
    WHERE 
        r.payment_order IN (1, 2) -- Include only the first and second payments
        AND r.ref_no = ref_no -- Filter by reference number input
    GROUP BY 
        r.empId, r.ref_no, r.salary, r.payroll_type, r.payroll_status, r.date_created, r.payment_order
    ORDER BY 
        r.empId, r.payment_order, r.date_created;
END$$

