CREATE DEFINER=`root`@`localhost` PROCEDURE `updateMultipleLeaveBalance` (IN `leave_typeId` VARCHAR(30), IN `new_value` BIGINT)   BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            ROLLBACK;
            RESIGNAL;
        END;

    START TRANSACTION;
    -- Update table1
    UPDATE leave_balance set  leave_balance.balance_amount = leave_balance.balance_amount + new_value
    where leave_type_id = leave_typeId;

    -- Update table1
    UPDATE leave_type set  leave_day_per_year= leave_type.leave_day_per_year + new_value
    where id = leave_typeId;

    COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `updateMultipleLeaveBalance2` (IN `leave_typeId` VARCHAR(30), IN `new_value` BIGINT)   BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            ROLLBACK;
            RESIGNAL;
        END;

    START TRANSACTION;
    -- Update table2
    UPDATE leave_balance set  leave_balance.balance_amount = leave_balance.balance_amount + (SELECT (new_value - leave_day_per_year)  FROM leave_type WHERE id = leave_typeId)
    where leave_balance.leave_type_id = leave_typeId;
    -- Update table1
    UPDATE leave_type set  leave_day_per_year = new_value
    where id = leave_typeId;

    COMMIT;
END$$

